import { useEffect, useState } from 'react';
import AddModal from '../AddModal/AddModal';
import Navbar from '../Navbar';
import getCroppedImg64 from '../getImage64';
import Cropper from 'react-easy-crop';
import CustomCheckbox from '../CustomCheckbox';

function Student() {
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:4000/service');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        // Фильтрация пустых или неполных записей
        const filteredStudents = data.students.filter(student => student.name);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
    return () => {
      // Cancel the request here if needed
    };
  }, []);

  return (
    <>
      <Navbar />

      <div className="App w-[100%] ">
        <div>
          <div className="w-[100%]">
            <div className="w-[4%] mx-4 items-center flex ">
              <img className="min-w-[6px] mx-2" src="/LeftLayer.svg" />
              <div>
                <span>Назад</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Student;
